SELECT (COUNT(DISTINCT ?p) AS ?n) WHERE {
  ?c1 a flat:Condition ;
      flat:patient_reference ?p .
  {
    ?c1 flat:icd9_code ?code1 .
  } UNION {
    ?c1 flat:icd10_code ?code1 .
  }
  BIND(UCASE(REPLACE(STR(?code1), "\\.", "")) AS ?n1)
  FILTER(?norm IN ("25000","41401","42741","427K41","4280","E119","I2510","I480","I4891","Z7950","Z955"))
  FILTER EXISTS {
    ?c2 a flat:Condition ;
        flat:patient_reference ?p .
    {
      ?c2 flat:icd9_code ?code2 .
    } UNION {
      ?c2 flat:icd10_code ?code2 .
    }
    BIND(UCASE(REPLACE(STR(?code2), "\\.", "")) AS ?n2)
    FILTER(?norm IN ("V5861","Z7901"))
  }
}

